 <b>ἀγεν-ής</b>, <i>ές</i>, (<i>γενέσθαι</i>) unborn, uncreated, Pl.Ti.27c. &nbsp;&nbsp;&nbsp;&nbsp;<b>II.</b> of no family, ignoble, opp. <i>ἀγαθός</i>, S.Fr.84, cf. POxy.33v5.5 (ii A. D.); of things, <i>οὐκ</i> <i>ἀγενεῖς</i> <i>στίχοι</i> Sch.Od.11.568; cf. AB336, St.Byz. s.v. <i>Ἀνακτορεία</i>. &nbsp;&nbsp;&nbsp;&nbsp;<b>III.</b> childless, Is.2.10, cf. Harp. (<i>ἄπαις</i> codd.).
